import React from "react";

const DonwloadScreen = () => {
  return (
    <div className="container download-container">
      <form className="form-inline">
        <input
          type="text"
          className="form-control"
          placeholder="buscar..."
        ></input>
      </form>
    </div>
  );
};

export default DonwloadScreen;
